    createThrusterMesh(options) {
      let geometry = false, texture = false, material = false, mesh = false;
      switch (options.geometry) {
        case "cone":
          geometry = new ConeGeometry(
            options.radius,
            options.height,
            options.radialSegments
          );
          break;
        case "cylinder":
          geometry = new CylinderGeometry(
            options.radius,
            // radiusTop
            options.radius,
            // radiusBottom
            options.height,
            options.radialSegments
          );
          geometry.openEnded = true;
          break;
      }
      texture = new VideoTexture(this.thruster.videoElement);
      texture.colorSpace = SRGBColorSpace;
      texture.wrapS = RepeatWrapping;
      texture.wrapT = RepeatWrapping;
      texture.repeat.set(1, options.texture_repeat);
      texture.rotation = -Math.PI / 2;
      const parameters = {
        depthWrite: false,
        map: texture,
        transparent: true
      };
      material = new MeshBasicMaterial(parameters);
      material.blending = CustomBlending;
      material.blendSrc = SrcAlphaFactor;
      material.blendDst = OneFactor;
      material.blendEquation = AddEquation;
      if (options.geometry == "cylinder") {
        material = [
          material,
          new MeshBasicMaterial({ visible: false }),
          new MeshBasicMaterial({ visible: false })
        ];
      }
      mesh = new Mesh(geometry, material);
      return mesh;
    }
